export const withoutSomeStrings = (arr, values) => {
  if (Array.isArray(values)) {
    return arr.filter(e => !values.includes(e));
  }
  return arr.filter(e => e !== values);
};
export const differenceStrings = (arr, values) => {
  if (Array.isArray(values)) {
    return arr.filter(e => values.includes(e));
  }
  return arr.filter(e => e === values);
};

